import './ShowResults.css';

const ShowResults = (props) => {
	return (
		<div>
			<h1>Łączny koszt wynajmu: {props.distance * props.d }</h1>
			<ul>
				<li>Koszt paliwa: {props.distance * props.d} </li>
				<li>Koszt spowodowany czasem posiadania prawa jazdy: {props.distance * props.d} </li>
				<li>Koszt marką samochodu: {props.distance * props.d} </li>
				<li>Koszt liczbą modeli samochodu: {props.distance * props.d} </li>
				<li>Koszt netto: {props.distance * props.d} </li>
				<li>Koszt brutto: {props.distance * props.d} </li>
			</ul>
			<button onClick={props.Change}>Wróć</button>
		</div>
	);
};

export default ShowResults;
